import React from "react";
import { Container, Row, Col } from "react-bootstrap";

const Footer = () => {
  return (
    <Container>
      <Row>
        <Col className="">
          <div>Footer</div>
        </Col>
      </Row>
    </Container>
  );
};

export default Footer;
